import DoorList from "./DoorList";
import "./Stage4.css";
const Stage4 = () => {
  return (
    <div id="stage4Div">
      <div>
        <pre> </pre>
        <p>Great Progress </p>
      </div>
      <br />
      <div>
        <h3>
          Looks like there are multiple doors here. Find the right one out.
        </h3>
      </div>
      <DoorList />
    </div>
  );
};

export default Stage4;
